from unittest import TestCase

from leetcode.p334_increasing_triplet_subsequence import increasing_triplet, increasing_triplet_single_pass


class Test(TestCase):

    def test_increasing_triplet_single_pass(self):
        self.assertEqual(True, increasing_triplet_single_pass([1,2,3,4,5]))
        self.assertEqual(True, increasing_triplet_single_pass([1,5,0,4,1,3]))
        self.assertEqual(False, increasing_triplet_single_pass([5,4,3,2,1]))
        self.assertEqual(True, increasing_triplet_single_pass([2,1,5,0,4,6]))
        self.assertEqual(False, increasing_triplet_single_pass([1]))

    def test_increasing_triplet(self):
        self.assertEqual(True, increasing_triplet([1,2,3,4,5]))
        self.assertEqual(True, increasing_triplet([1,5,0,4,1,3]))
        self.assertEqual(False, increasing_triplet([5,4,3,2,1]))
